function QueueWithPriority(arr) {
  var buffer = Array.isArray(arr) ? arr : [];

  var sorted = false;
  var sortedBuffer = function() {
    if(!sorted) {
      buffer.sort((a, b) => (a > b) ? 1 : (a < b)? -1 : 0);// this one for fixing string-sorting at js ( for input = 132 for example )
      sorted = true;
    }
    return buffer;
  }
  this.getMax = function() {
    return sortedBuffer().pop();
  };
  this.add = function(val) {
    buffer.push(val);
    sorted = false;
  };
  this.peekMax = function() {
    return sortedBuffer()[buffer.length - 1];
  }
  this._getBuffer = function() {
    return sortedBuffer();
  }
  this.isEmpty = function() {
    return buffer.length === 0;
  }
}

function getAnswer() {
  var k = +lines[2];
  var fruits = lines[1].split(' ').map((item) => +item);

  var queueWithPriority = new QueueWithPriority(fruits);
  var count = 0;
  while(!queueWithPriority.isEmpty()) {
    count++;
    var attemptList = [];
    var attempWeight = 0;
    while(attempWeight <= k && !queueWithPriority.isEmpty()) {
      var fruit = queueWithPriority.getMax();
      attemptList.push(fruit);
      attempWeight += fruit;
      if((attempWeight + queueWithPriority.peekMax()) > k){
        break;
      }
    }

    var fruitsBackToBasket = attemptList.filter((item) => item>1).map((item) => Math.floor(item/2));
    fruitsBackToBasket.forEach((item) => queueWithPriority.add(item));

    //console.log(`[${count}]: try [${attemptList.join(', ')}] return to basket [${fruitsBackToBasket.join(', ')}] basket state is [${queueWithPriority._getBuffer().join(', ')}]`);
  }

  return count;
}

rl.on('line', function(line) {
  lines.push(line);
  if(lines.length === 3) {
    var testLine = lines.join('|');
    if(knownTests.indexOf(testLine) <0 ){ // workaround to get failed tests on stepic
      throw(testLine);
    }

    return console.log(getAnswer());
  }
});
